import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import AllChefs from "./pages/AllChefs";
import Blogs from "./pages/Blogs";
import Categories from "./pages/Categories";
import Home from "./pages/Home";
import OneChef  from "./pages/OneChef";
import Recipes from "./pages/Recipes";


function Index() {
  return (
    <Home></Home>
  )
}

function Featured() {
  return (
    <AllChefs></AllChefs>
  )
}

function Articles() {
  return (
    <Blogs></Blogs>
  )
}

function Ingredients() {
  return (
    <Categories></Categories>
  )
}

function Meal() {
  return (
    <Recipes></Recipes>
  )
}

class App extends React.Component {

  handleSend = (id) => {
    alert(id);
  }

  render() {
    const currentRecipe = {
      title: "EFFORTLESS BLACK BEAN CHILI"
    }
    return (
      <Router>
          <div>
            <Switch>
              <Route exact path="/" render={(props) => <Home {...props} handleSend={this.handleSend} />} />
              <Route exact path="/allchefs" component={AllChefs} />
              <Route exact path="/blogs" component={Blogs} />
              <Route exact path="/categories" component={Categories} />
              <Route exact path="/onechef" render={(props) => <OneChef {...props} title={currentRecipe.title} />} />
              <Route exact path="/recipes" component={Recipes} />
              {/* <Route component={NoMatch} /> */}
            </Switch>
          </div>
      </Router>
    );
  }

}


export default App;
